    // console.log("balance: ", IERC20(info.debtToken).balanceOf(address(this)));
    // console.log("Pool Address: ", info.poolPath[0].poolAddress);
    IERC20(info.debtToken).safeTransfer(info.poolPath[0].poolAddress, info.debtAmount);
